import React from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';
import FilterBar from '../components/FilterBar';
import NextBusCard from '../components/NextBusCard';

const TrackerContainer = styled.div`
  padding: 2rem;
  max-width: 800px;
  margin: 0 auto;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  color: #002B5C;
  margin-bottom: 1rem;
`;

const Tracker = () => {
  // Placeholder predicted time; later replaced with real API call
  const predictedTime = "3:09 PM";

  return (
    <div>
      <Navbar />
      <TrackerContainer>
        <Title>Bus Tracker</Title>
        <FilterBar />
        <NextBusCard predictedTime={predictedTime} />
      </TrackerContainer>
    </div>
  );
};

export default Tracker;
